def filter_genres(genres_list, metal_genres):
    
    # Create a set of genres to remove
    genres_to_remove = set(metal_genres['genres'])
    
    # Filter the genres in genres_list
    new_genres = [genre for genre in genres_list['genres'] if genre not in genres_to_remove]
    
    # Return a new dictionary with the filtered genres
    return {'genres': new_genres}


filtered_genres = filter_genres(genres_list, metal_genres)
